import React from 'react';
import { 
  View, 
  Text, 
  StyleSheet, 
  TouchableOpacity, 
  ScrollView, 
  SafeAreaView 
} from 'react-native';
import { Ionicons } from '@expo/vector-icons';

export default function ProfileDetailsScreen({ navigation }) {
  const FormField = ({ label, value, editable = true, validated = false }) => (
    <View style={styles.fieldContainer}>
      <Text style={styles.fieldLabel}>{label}</Text>
      <View style={styles.inputContainer}>
        <Text style={styles.fieldValue}>{value}</Text>
        {editable && (
          <TouchableOpacity>
            <Ionicons name="pencil" size={20} color="#4A90E2" />
          </TouchableOpacity>
        )}
      </View>
      {validated && (
        <View style={styles.validationContainer}>
          <Ionicons name="checkmark-circle" size={16} color="#4CAF50" />
          <Text style={styles.validationText}>Correo electrónico validado</Text>
        </View>
      )}
    </View>
  );

  return (
    <SafeAreaView style={styles.container}>
      {/* Header */}
      <View style={styles.header}>
        <TouchableOpacity onPress={() => navigation.goBack()}>
          <Ionicons name="arrow-back" size={24} color="#4A90E2" />
        </TouchableOpacity>
        <Text style={styles.headerTitle}>Datos de perfil</Text>
      </View>

      <ScrollView style={styles.content}>
        {/* Form Fields */}
        <FormField label="*Apellido" value="GARCIA" />
        <FormField 
          label="*Correo electrónico" 
          value="fabian630618@hotmail.com" 
          validated={true}
        />
        <FormField label="Fecha de nacimiento" value="Fecha de nacimiento" />
        <FormField label="Identificación" value="Identificación" />
        <FormField label="Celular" value="Celular" />

        {/* Phone Verification Warning */}
        <View style={styles.warningContainer}>
          <Ionicons name="warning" size={20} color="#FFA000" />
          <Text style={styles.warningText}>
            Es necesario verificar el número de teléfono
          </Text>
        </View>

        {/* Emergency Contact */}
        <TouchableOpacity style={styles.emergencyContact}>
          <Text style={styles.emergencyContactText}>Contacto de emergencia</Text>
          <Ionicons name="chevron-down" size={24} color="#666" />
        </TouchableOpacity>

        {/* Delete Account */}
        <TouchableOpacity style={styles.deleteAccount}>
          <Ionicons name="trash-outline" size={24} color="#666" />
          <Text style={styles.deleteAccountText}>Eliminar cuenta</Text>
          <Ionicons name="chevron-forward" size={24} color="#666" />
        </TouchableOpacity>

        {/* Save Button */}
        <TouchableOpacity style={styles.saveButton}>
          <Text style={styles.saveButtonText}>Guardar</Text>
        </TouchableOpacity>
      </ScrollView>
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#F5F5F5',
  },
  header: {
    flexDirection: 'row',
    alignItems: 'center',
    padding: 16,
    backgroundColor: '#FFFFFF',
    borderBottomWidth: 1,
    borderBottomColor: '#E0E0E0',
  },
  headerTitle: {
    fontSize: 20,
    fontWeight: '500',
    marginLeft: 16,
  },
  content: {
    flex: 1,
    padding: 16,
  },
  fieldContainer: {
    backgroundColor: '#FFFFFF',
    borderRadius: 12,
    padding: 16,
    marginBottom: 16,
  },
  fieldLabel: {
    fontSize: 14,
    color: '#666',
    marginBottom: 8,
  },
  inputContainer: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
  },
  fieldValue: {
    fontSize: 16,
    color: '#333',
  },
  validationContainer: {
    flexDirection: 'row',
    alignItems: 'center',
    marginTop: 8,
  },
  validationText: {
    fontSize: 14,
    color: '#4CAF50',
    marginLeft: 8,
  },
  warningContainer: {
    flexDirection: 'row',
    alignItems: 'center',
    padding: 16,
    marginBottom: 16,
  },
  warningText: {
    fontSize: 14,
    color: '#FFA000',
    marginLeft: 8,
  },
  emergencyContact: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    backgroundColor: '#FFFFFF',
    borderRadius: 12,
    padding: 16,
    marginBottom: 16,
  },
  emergencyContactText: {
    fontSize: 16,
    color: '#333',
  },
  deleteAccount: {
    flexDirection: 'row',
    alignItems: 'center',
    backgroundColor: '#FFFFFF',
    borderRadius: 12,
    padding: 16,
    marginBottom: 24,
  },
  deleteAccountText: {
    fontSize: 16,
    color: '#333',
    marginLeft: 12,
    flex: 1,
  },
  saveButton: {
    backgroundColor: '#4A90E2',
    borderRadius: 25,
    padding: 16,
    alignItems: 'center',
    marginBottom: 32,
  },
  saveButtonText: {
    color: '#FFFFFF',
    fontSize: 16,
    fontWeight: '500',
  },
});
